import React from 'react';

const Leftbar = () => {
    return (
        <div className="leftbar">
        <p>Dashboard</p>
        <p>Widget</p>
        <p>Reviews</p>
        <p>Customers</p>
        <p>Online Analysis</p>
        <p>Settings</p>
        </div>
    );
};

export default Leftbar;
